import React ,{Component} from 'react';
import Person from '../person/Person'


class OutputtingLists extends Component
{
    state={
        persons:[
        {name:"vaishnavi", age:21},
        {name:"madhvi", age:23},
        {name:"sonu", age:21},
        {name:"bhagya", age:22}
        ]
    }



    render()
    {
        return(
            <div>
                <Person name={this.state.persons[0]}/>
            </div>
        );
    }
} 

export default OutputtingLists;
